import React, { Component } from 'react'
import PropTypes from "prop-types";

export class Welcome extends Component {



    render() {

        return (
            <div>
                <h1>{message()}</h1>


            </div>
        )
    }
}

const user = () => {
    this.props.users.array.forEach(element => {
        if (element.active) {
            return element.firstName
        }
    });
};

const message = () => {
    return `Welcome ${user()}`
}

export default Welcome
